const ProductData = () => {
	return [
		{
			id: 1,
			title: 'Product 1',
			image: 'product1.jpg',
			price: 9.99
		},
		{
			id: 2,
			title: 'Product 2',
			image: 'product2.jpg',
			price: 19.99
		},
		{
			id: 3,
			title: 'Product 3',
			image: 'product3.jpg',
			price: 29.99
		}
		// Add more products as needed
	];
};

export default ProductData;
